INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 1, 1, 0, 1, 40011, 24001, 321, 2, 125801);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 1, 1, 0, 2, 40011, 24001, 322, 2, 126001);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("んーと。\nこれ、あげる。\nはい", "プレシア", 1, 1, 0, 3, 40011, 24001, 323, 2, 126101);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 2, 1, 0, 4, 40011, 24001, 324, 2, 125801);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 2, 1, 0, 5, 40011, 24001, 325, 2, 126001);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("お兄。\nきてくれて、うれしい", "プレシア", 2, 1, 0, 6, 40011, 24001, 326, 2, 126101);
